import React, { useEffect, useState, useRef } from 'react';
import { useLocation } from 'react-router-dom';
import './Completeview.css';
import ProductGrid from './ProductGrid';
import { Rating } from '@mui/material';

const CompleteView = () => {
  const location = useLocation();
  const { product } = location.state;
  const [initialLoad, setInitialLoad] = useState(true);
  const [popupOpen, setPopupOpen] = useState(false);
  const popupRef = useRef(null);

  useEffect(() => {
    window.scrollTo(0, 0);
    const timer = setTimeout(() => {
      setInitialLoad(false);
    }, 1000);

    return () => clearTimeout(timer);
  }, []);

  const handleClickOutside = (event) => {
    if (popupRef.current && !popupRef.current.contains(event.target)) {
      setPopupOpen(false);
    }
  };

  useEffect(() => {
    if (popupOpen) {
      document.addEventListener('mousedown', handleClickOutside);
    } else {
      document.removeEventListener('mousedown', handleClickOutside);
    }

    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [popupOpen]);

  return (
    <>
      <div className="complete-view">
        <div className="frames">
          {[product.front, product.back || product.imgSrc, product.thirdImgSrc || product.f3, product.fourthImgSrc || product.f4].map((src, index) => (
            <div className="frame" key={index}>
              <img
                src={src}
                alt={product.title}
                className={initialLoad ? 'initial-zoom' : ''}
              />
            </div>
          ))}
        </div>

        <div className="product-info">
          <h1>{product.title}</h1>
          <div className="reviews">
            <span>{'⭐'.repeat(product.rating)}</span>
            <span>157 Reviews</span>
          </div>
          <div className="price">
            <span className="current-price">Rs.{product.price} </span>
            <span className="discount">Save {product.discount}% right now</span>
          </div>
          <div className="features">
            <h4>Features</h4>
            <ul>
              <li> {product.description} </li>
            </ul>
          </div>


          <div className="colors">
            <h4>Colors</h4>
            <div className="color-options">
              {product.colors.map((color, index) => (
                <button key={index} className={`color ${color}`}></button>
              ))}
            </div>
          </div>


          <div className="Size-option">
            <h4>Size</h4>
            <div className="Size-options">
              {product.sizes.map((size, index) => (
                <button key={index} className={`size ${size}`}>{size}</button>
              ))}
            </div>
          </div>

          <div className="action-buttons">
            <button className="add-to-cart">Buy Now</button>
            <button className="add-to-cart">Add to Cart</button>
            <button className="wishlist">
              <span> ♡ </span>
            </button>
          </div>
        </div>
      </div>

      <ProductGrid />
    </>
  );
};

export default CompleteView;
